template <typename Scalar>
inline void GlobalAvgPooling1D_cnn_1d_02(Scalar * __restrict outputs, const Scalar * __restrict inputs, int in_length, int channels)
{
    for (int ic = 0; ic < channels; ic++)
    {
        Scalar sum = 0;

        for (int i = 0; i < in_length; i++)
        {
            int idx = (i * channels) + ic;
            sum += inputs[idx];
        }
        outputs[ic] = sum / (in_length);
    }
}

template<typename Scalar, int output_size, typename ActFun>
inline void Dense_cnn_1d_02(Scalar* __restrict outputs, const Scalar* __restrict inputs, const Scalar * __restrict weights, const Scalar * __restrict biases, int input_size, ActFun activation_function, Scalar alpha) noexcept 
{
    for(int i = 0; i < output_size; ++i){
        Scalar sum = 0;
        
        for(int j = 0; j < input_size; ++j){
            sum += inputs[j] * weights[j * output_size + i];
        }
        sum += biases[i];
        activation_function(outputs[i], sum, alpha);
    }
}

template <typename Scalar, int size>
inline void BatchNormalization_cnn_1d_02(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict gamma, const Scalar * __restrict beta, const Scalar * __restrict mean, const Scalar * __restrict variance, const Scalar epsilon) noexcept
{
    
    for (int i = 0; i < size; ++i)
    {
        outputs[i] = gamma[i] * ((inputs[i] - mean[i]) / std::sqrt(variance[i] + epsilon)) + beta[i];
    }
}

template <typename Scalar, int out_size, typename ActFun>
inline void Conv1D_cnn_1d_02(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict weights, const Scalar * __restrict biases,
                   int in_size, int kernel_size, int stride, int padding,
                   ActFun activation_function, Scalar alpha) noexcept
{
    for (int o = 0; o < out_size; ++o)
    {
        Scalar sum = 0;
        
        for (int k = 0; k < kernel_size; ++k)
        {
            int in_index = o * stride - padding + k;
            if (in_index >= 0 && in_index < in_size)
            {
                int weight_index = k * out_size + o;
                sum += inputs[in_index] * weights[weight_index];
            }
        }
        sum += biases[o];
        activation_function(outputs[o], sum, alpha);
    }
}

template <typename Scalar, int pool_size, int stride>
inline void MaxPooling1D_cnn_1d_02(Scalar * __restrict outputs, const Scalar * __restrict inputs, int in_length, int channels) noexcept
{
    int out_length = (in_length - pool_size) / stride + 1;
    for (int c = 0; c < channels; ++c)
    {
        for (int o = 0; o < out_length; ++o)
        {
            Scalar max_val = inputs[(o * stride * channels) + c];
            
            for (int p = 0; p < pool_size; ++p)
            {
                int idx = ((o * stride + p) * channels) + c;
                if (inputs[idx] > max_val)
                {
                    max_val = inputs[idx];
                }
            }
            outputs[o * channels + c] = max_val;
        }
    }
}

